def get_value(key: str, data: dict, val=None) -> object:
    if val == None:
        val = []
    if isinstance(data, dict):
        for k, v in data.items():
            if k == key:
                val.append(v)
            else:
                if isinstance(v, dict):
                    get_value(key, v, val)
                elif isinstance(v, list):
                    for each in v:
                        get_value(key, each, val)
    return val


